SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
CREATE TABLE IF NOT EXISTS `?sl_comuni` (
  `regione_id` varchar(2) DEFAULT NULL,
  `provincia_id` varchar(3) DEFAULT NULL,
  `provincia_sigla` varchar(5) DEFAULT NULL,
  `comune_id` varchar(6) NOT NULL DEFAULT '',
  `comune_cap` varchar(20) DEFAULT NULL,
  `comune_denominazione_IT_TE` varchar(60) DEFAULT NULL,
  `comune_nome` varchar(35) DEFAULT NULL,
  `comune_denominazione_TE` varchar(36) DEFAULT NULL,
  `comune_cap_provincia` varchar(1) DEFAULT NULL,
  `comune_zona_altimetrica` varchar(1) DEFAULT NULL,
  `comune_altitudine` varchar(7) DEFAULT NULL,
  `comune_litoraneo` varchar(1) DEFAULT NULL,
  `comune_montano` varchar(2) DEFAULT NULL,
  `comune_cod_sis_lavoro` varchar(3) DEFAULT NULL,
  `comune_denom_sis_lavoro` varchar(49) DEFAULT NULL,
  `comune_superficie_territoriale_totale_kmq` varchar(7) DEFAULT NULL,
  PRIMARY KEY (`comune_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE IF NOT EXISTS `?sl_province` (
  `regione_id` varchar(14) DEFAULT NULL,
  `provincia_id` varchar(16) NOT NULL DEFAULT '',
  `provincia_nome` varchar(28) DEFAULT NULL,
  `provincia_sigla` varchar(21) NOT NULL DEFAULT '',
  PRIMARY KEY (`provincia_id`),
  UNIQUE KEY `codice_regione` (`regione_id`,`provincia_id`,`provincia_nome`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
CREATE TABLE IF NOT EXISTS `?sl_regioni` (
  `regione_id` varchar(255) NOT NULL,
  `regione_nome` varchar(255) NOT NULL,
  PRIMARY KEY (`regione_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;
